import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import './TeamPage.css';

const TeamPage = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const teams = location.state?.teams || [];

  return (
    <div className="team-page">
      <header>
        <h1>Research Teams</h1>
      </header>
      {teams.length === 0 ? (
        <p className="no-teams">No teams formed.</p>
      ) : (
        <div className="teams-list">
          {teams.map((team, index) => (
            <div key={index} className="team-card">
              <h2>Team {team.team_id} (Size: {team.team_size})</h2>
              <section className="team-research">
                <h3>Team Research Areas:</h3>
                <ul>
                  {team.team_research_areas.map((area, idx) => (
                    <li key={idx}>{area}</li>
                  ))}
                </ul>
              </section>
              <section className="team-members">
                <h3>Members:</h3>
                <ul>
                  {team.members.map((member, idx) => (
                    <li key={idx}>
                      <span className="member-name">{member}</span>
                      {team.member_fields[member] && (
                        <ul className="member-fields">
                          {team.member_fields[member].map((field, fidx) => (
                            <li key={fidx}>{field}</li>
                          ))}
                        </ul>
                      )}
                    </li>
                  ))}
                </ul>
              </section>
            </div>
          ))}
        </div>
      )}
      <button onClick={() => navigate('/')} className="back-button">
        Back to Home
      </button>
    </div>
  );
};

export default TeamPage;
